import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <Parallax className = 'Parallax' ref={ref => (this.parallax = ref)} pages={3.1}>
                    <ParallaxLayer className = 'SciFiParallax' speed={1} offset={.04}>
                        <div>
                            <h1>SciFi</h1>
                        </div>
                    </ParallaxLayer>
                </Parallax>

            </div>

        )
    }

}
